【送料無料】カスタムパロディーエンブレム【ネコポスでの発送となります】<br>
VELLPHARD（ヴェルファード）<BR><BR>

アルファード/ヴェルファイア用 <BR><br><br>

アルファードでもなくヴェルファイアでもなく、ヴェルファード！？<br>
皆が二度見すること間違いなし！！<br><br>

【ロゴカラー】<br>
・クロームメッキ<br>
・マットブラック<br><br>

クロームメッキタイプとマットブラックタイプのロゴエンブレムです。<br>
文字は一文字ずつバラバラで繋がっておりません。<br>
一文字当たりの大きさは約縦17.3mm位で、横幅は文字により異なります。<br>
しっかりと厚み（3mm～4mm）のある商品です。<br>
樹脂製メッキ仕上げ、両面テープにて貼り付け取り付け。<br>
両面テープは各文字側に貼り付け済みです。<br><br>

常備在庫をしておりますが、欠品の場合は納期が1週間となります場合がございます。

<br><br>
【ご注意】<br>
※在庫がある場合は、1～2営業日で出荷可能！<br>
※お急ぎの方はご注文前に納期お問い合わせ下さい。<br><br><br>
